import './App.css';

import { products } from "./proddetails"
import { useState } from "react";
import { Table } from "./table"

type productType =
  {
    id: number;
    title: string;
    price: number;
    brand: string;
    rating: number;
  }[]


function App() {
  const [query, setQuery] = useState("");

  const searching = (productobj: productType) => {
    return productobj.filter((item) => item.title.toLowerCase().includes(query) || item.id.toString().includes(query))
  }

  return (
    <div className="App">
      <input type="text"
        placeholder="Search Product Id Or Product Name"
        className="search"
        onChange={(e) => setQuery(e.target.value.toLowerCase())}
      />

      <Table filterdata={searching(products)}></Table>

    </div>
  );
}

export default App;
